    false,nt"url": null,nt"notes": "This narrative report for Tamarac NWR outlines
    Refuge accomplishments from September through December of 1946. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments and plantings. Resource management
    is outlined; topics include grazing, haying, fur harvesting, and timber removal.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, fishing, and violations. N-R forms are attached.",nt"license_title":
